import './App.css';
import Login from './components/Login'
import { Router, Routes, Route } from 'react-router-dom'
import Home from './components/Home';



function App() {
  return (
    <div className="App">


      <Router>
        <Routes>
          <Route path="/" element={<Home />} />
        </Routes>
      </Router>
      <Login />



    </div>
  );
}

export default App;
